import {Link} from 'react-router-dom';

function Navigation(){
    return (
        <header>
            <nav>
                <ul>
                    <li><Link to = '/'>About Us</Link></li>
                    <li><Link to = '/'>Registration</Link></li>
                </ul>
            </nav>
        </header>
    );
}
export default Navigation;
